$(document).ready(function(){var a=getParameterByName("?");if(a===""){unFound()}search(a)});function unFound(){document.location="/unfound.html";location.replace("/unfound.html")}function search(c){var b=false;$.getJSON("/js/tv-min.json",function(f){for(var j in f){if(!f.hasOwnProperty(j)){console.log("prop fail");continue}var h=f[j][0]["Title"];var i=h.toUpperCase();var g=c.toUpperCase();if(i.includes(g)){var d=f[j][0]["PosterURL"];var e=f[j][0]["ID"];createTVPoster(e,d);b=true}}});var a=0;$.getJSON("/js/movies.json",function(f){for(var j in f){if(!f.hasOwnProperty(j)){console.log("prop fail");continue}var i=f[j][0]["Title"];var h=i.toUpperCase();var g=c.toUpperCase();if(h.includes(g)){var d=f[j][0]["PosterURL"];var e=f[j][0]["ID"];createMoviePoster(e,d);b=true}a+=1}});if(b===false){$(".title").html("No Results Found!")}}function createTVPoster(e,f){var c=document.createElement("A");c.href="/episode-list.html?="+e;var b=document.createElement("IMG");b.setAttribute("class","spaced hor-spaced");b.src=f;if(screen.width<=699||navigator.userAgent.match(/iPhone/i)||navigator.userAgent.match(/iPod/i)){b.height=512;b.width=300}else{b.height=256;b.width=150}var d=document.getElementById("addNew");d.appendChild(c);c.appendChild(b);$(".title").html("Results")}function createMoviePoster(e,f){var c=document.createElement("A");c.href="/details.html?="+e;var b=document.createElement("IMG");b.setAttribute("class","spaced hor-spaced");b.src=f;if(screen.width<=699||navigator.userAgent.match(/iPhone/i)||navigator.userAgent.match(/iPod/i)){b.height=512;b.width=300}else{b.height=256;b.width=150}var d=document.getElementById("addNew");d.appendChild(c);c.appendChild(b);$(".title").html("Results")}function getParameterByName(b,a){if(!a){a=window.location.href}b=b.replace(/[\[\]]/g,"\\$&");var d=new RegExp("[?&]"+b+"(=([^&#]*)|&|#|$)"),c=d.exec(a);if(!c){return null}if(!c[2]){return""}return decodeURIComponent(c[2].replace(/\+/g," "))};